import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import styled from "styled-components";
import { DateRangePicker } from "react-date-range";
import { Carousel } from "react-responsive-carousel";
import "react-date-range/dist/styles.css";
import "react-date-range/dist/theme/default.css";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { useContext } from "react";
import { AuthContext } from "../../hooks/context";

const VenuePage = () => {
    const { id } = useParams();
    const [venue, setVenue] = useState(null);
    const [startDate, setStartDate] = useState(new Date());
    const [endDate, setEndDate] = useState(new Date());
    const [disabledDates, setDisabledDates] = useState([]);
    const [bookedDates, setBookedDates] = useState([]);

    const { isLoggedIn } = useContext(AuthContext);

    useEffect(() => {
        const getVenue = async (id) => {
            const response = await fetch(
                `https://api.noroff.dev/api/v1/holidaze/venues/${id}`
            );
            const data = await response.json();

            if (data && data.bookings) {
                /*setDisabledDates(
                    data.bookings.map((booking) => [
                        new Date(booking.dateFrom),
                        new Date(booking.dateTo),
                    ])
                );
            }*/ const bookedDateRanges = data.bookings.map((booking) => ({
                    startDate: new Date(booking.dateFrom),
                    endDate: new Date(booking.dateTo),
                }));
                setBookedDates(bookedDateRanges);
            }
            return data;
        };
        getVenue(id).then((data) => setVenue(data));
    }, [id]);

    if (!venue) return <div>Loading...</div>;

    const handleSelect = (ranges) => {
        setStartDate(ranges.selection.startDate);
        setEndDate(ranges.selection.endDate);
    };

    const selectionRange = {
        startDate: startDate,
        endDate: endDate,
        key: "selection",
    };

    return (
        <VenueContainer>
            <CarouselWrapper>
                <Carousel>
                    {venue.media.map((img, index) => (
                        <div key={index}>
                            <img src={img} alt={`Image ${index}`} />
                        </div>
                    ))}
                </Carousel>
            </CarouselWrapper>
            <ContentWrapper>
                <VenueInfo>
                    <h2>{venue.name}</h2>
                    <p>{venue.description}</p>
                    <p>Price: {venue.price}</p>
                    <p>Max guests: {venue.maxGuests}</p>
                    <p>Rating: {venue.rating}</p>
                    <p>Address: {venue.location.address}</p>
                    <p>City: {venue.location.city}</p>
                </VenueInfo>
                <DateRangePickerWrapper>
                    <DateRangePicker
                        ranges={[selectionRange]}
                        onChange={handleSelect}
                        disabledDates={disabledDates}
                    />
                </DateRangePickerWrapper>
                <BookButton disabled={!isLoggedIn}>Book Now</BookButton>
            </ContentWrapper>
        </VenueContainer>
    );
};

export default VenuePage;

const VenueContainer = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 2rem;
`;

const CarouselWrapper = styled.div`
    max-width: 800px;
    margin-bottom: 2rem;

    .carousel {
        margin-bottom: 2rem;
    }

    .carousel .slide img {
        max-height: 400px;
        object-fit: cover;
    }
`;

const ContentWrapper = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 100%;
    max-width: 600px;
`;

const VenueInfo = styled.div`
    display: flex;
    flex-direction: column;
    gap: 2rem;
    text-align: center;
    margin-bottom: 2rem;

    h2 {
        font-size: 2rem;
        margin-bottom: 0.5rem;
    }

    p {
        margin-bottom: 0.5rem;
    }
`;

const DateRangePickerWrapper = styled.div`
    width: 100%;
    margin-bottom: 2rem;
`;

const BookButton = styled.button`
    padding: 1rem 2rem;
    background-color: var(--primary);
    color: white;
    font-weight: bold;
    border-radius: 10px;
    cursor: pointer;
    border: none;
    transition: background-color 0.3s ease;

    &:hover {
        background-color: var(--secondary);
        color: black;
    }

    &:disabled {
        background-color: #ccc;
        cursor: not-allowed;
    }
`;
